    'content': React.createElement("article", { dangerouslySetInnerHTML: {
            __html: '<h2 id="格式">格式<a class="anchor" href="Requests/Format.html#格式">§</a></h2>\n<p>路由可以通过<code>format</code>参数指定接受的request请求或者返回的response的数据格式。参数的值为指定HTTP媒体类型的一个字符串。例如，JSON数据参数值为<code>application/json</code>。</p>\n<p>当路由指定的方法为带有请求体的方法（PUT, POST, DELETE, 和 PATCH），指定<code>format</code>属性之后，Rockt就会检测新来的请求的header中的<code>Content-Type</code>。只有请求的<code>Content-Type</code>和参数<code>format</code>中的值一直的时候才能匹配该路由。</p>\n<p>请思考下面的例子：</p>\n<pre class="language-rust"><code class="language-rust"><span class="token attribute attr-name">#[post(<span class="token string">"/user"</span>, format = <span class="token string">"application/json"</span>, data = <span class="token string">"&lt;user>"</span>)]</span>\n<span class="token keyword">fn</span> <span class="token function-definition function">new_user</span><span class="token punctuation">(</span>user<span class="token punctuation">:</span> Json<span class="token operator">&lt;</span>User<span class="token operator">></span><span class="token punctuation">)</span> <span class="token punctuation">-></span> T <span class="token punctuation">{</span> <span class="token punctuation">...</span> <span class="token punctuation">}</span>\n</code></pre>\n<p>在<code>post</code>属性中<code>format</code>参数声明了，新来的请求中,仅仅为<code>Content-Type: application/json</code>才能匹配<code>new_user</code>路由。（参数<code>data</code>会在下一节中讲到）。</p>\n<p>当路由指定的是没有请求体的方法（GET, HEAD, 和 OPTIONS），指定<code>format</code>参数之后，Rocket会检测新来的请求中header中的<code>Accept</code>。仅仅在header的<code>Accept</code>中指定的希望收到的媒体类型和<code>format</code>参数指定的一致的请求才会匹配。</p>\n<p>请思考下面的例子：</p>\n<pre class="language-rust"><code class="language-rust"><span class="token attribute attr-name">#[get(<span class="token string">"/user/&lt;id>"</span>, format = <span class="token string">"application/json"</span>)]</span>\n<span class="token keyword">fn</span> <span class="token function-definition function">user</span><span class="token punctuation">(</span>id<span class="token punctuation">:</span> <span class="token keyword">usize</span><span class="token punctuation">)</span> <span class="token punctuation">-></span> Json<span class="token operator">&lt;</span>User<span class="token operator">></span> <span class="token punctuation">{</span> <span class="token punctuation">...</span> <span class="token punctuation">}</span>\n</code></pre>\n<p>在<code>get</code>属性中的<code>format</code>参数指明了，在新来的请求中header中的<code>Accept</code>指定的媒体类型为<code>application/json</code>时才能匹配<code>user</code>。</p>'
        } }),
